import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the first "Add to Cart" button (product grid)
    await page.waitForSelector('.add-to-cart', { timeout: 5000 });

    // Rapid Cart Manipulation Stress Test
    // 1. Add first 3 products to cart, 5 times each (simulate rapid add)
    for (let i = 0; i < 3; i++) {
      const addToCartButtons = await page.$$('.add-to-cart');
      if (addToCartButtons[i]) {
        for (let j = 0; j < 5; j++) {
          await addToCartButtons[i].click();
        }
      }
    }
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_added_multiple.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_added_multiple.png'));

    // 2. Open Cart (find .cart or Cart text, click to open modal)
    // Try .cart class div
    await page.waitForSelector('.cart', { timeout: 5000 });
    await page.click('.cart');
    // Wait for cart modal to appear
    await page.waitForSelector('#cartModal', { timeout: 5000 });
    await page.waitForSelector('#cartItems', { timeout: 5000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_opened.png'));

    // 3. Rapidly increase/decrease quantity of first cart item
    // Wait for quantity + and - buttons
    const plusBtn = await page.$('.cart-item .quantity-btn:nth-of-type(2)');
    const minusBtn = await page.$('.cart-item .quantity-btn:nth-of-type(1)');
    if (plusBtn && minusBtn) {
      // Rapidly click plus 3 times
      for (let i = 0; i < 3; i++) {
        await plusBtn.click();
      }
      // Rapidly click minus 2 times
      for (let i = 0; i < 2; i++) {
        await minusBtn.click();
      }
    }
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_quantity_changed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_quantity_changed.png'));

    // 4. Remove the first cart item
    const removeBtn = await page.$('.cart-item .remove-item');
    if (removeBtn) {
      await removeBtn.click();
    }
    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_item_removed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_item_removed.png'));

    // 5. Proceed to Checkout (if button exists)
    const checkoutBtn = await page.$('.checkout-btn');
    if (checkoutBtn) {
      await checkoutBtn.click();
      await page.screenshot({ path: path.join(screenshotsDir, 'step_6_checkout_clicked.png') });
      screenshots.push(path.join(screenshotsDir, 'step_6_checkout_clicked.png'));
    }

    // Extract cart summary from modal
    let cartSummary = {};
    try {
      // Wait for cart total
      await page.waitForSelector('#cartTotal', { timeout: 2000 });
      const total = await page.$eval('#cartTotal', el => el.textContent.trim());
      // Count items in cart
      const cartItems = await page.$$('#cartItems .cart-item');
      cartSummary = {
        total,
        itemsInCart: cartItems.length
      };
    } catch (e) {
      cartSummary = { error: 'Could not extract cart summary' };
    }

    return {
      success: true,
      action: "Performed rapid cart manipulation: added products, changed quantities, removed item, and attempted checkout",
      extractedData: cartSummary,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
